import { Button } from '@mui/material'
import React from 'react'
import { User } from './User'

interface userProps {
    user : User
}

const UserItem = ({user}: userProps) => {
    return (<>
            <Button size="large" variant="contained">
                {user.data}
            </Button>

        </>
    )
}

export default UserItem;
